function ConvertFrom-Base64ToIcon {
    param(
        [Parameter(Mandatory=$true)]
        [string]$base64String
    )
    $iconBytes = [Convert]::FromBase64String($base64String)
    $memoryStream = New-Object System.IO.MemoryStream($iconBytes, 0, $iconBytes.Length)
    $memoryStream.Write($iconBytes, 0, $iconBytes.Length)
    return [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::new($memoryStream)).GetHIcon())
}

